										opDetails.progressLogs.find((log: OperationProgressLog) => log.status?.toLowerCase() === "failure");

									if (failedLog?.message) {
										return `${serviceCreationFailedMessage}: ${failedLog.message}`;
									}

									// If no specific failed log was found but there are logs, return the last log message
									if (opDetails.progressLogs.length > 0) {
										const lastLog = opDetails.progressLogs[opDetails.progressLogs.length - 1];
										return lastLog.message || service?.errorMessage || serviceCreationFailedMessage;
									}

									// Fallback to service error message or generic error message
									return service?.errorMessage || serviceCreationFailedMessage;
								})()
